  false,\n\t\"url\": null,\n\t\"notes\": \"Chemical and physical oceanographic profile
  data were collected aboard the HOS Davis in the Gulf of Mexico from 2010-08-13 to
  2010-08-22 in response to the Deepwater Horizon oil spill event on April 20, 2010,
  by the Subsurface Monitoring Unit (SMU), which consists of multiple government and
  corporate agencies. These data include CDOM fluorescence, conductivity, dissolved
  oxygen, fluorescence, hydrostatic pressure, salinity, sound velocity, temperature
  and water density. The instruments used to collect these data were CTD, fluorometer
  and oxygen meter. These data have undergone quality assurance and control procedures
  to validate their scientific integrity at the National Coastal Data Development
  Center. (NODC Accession 0069069)\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
